import React from 'react';
import './App.css';
import pokeList from './data';
import Pokemon from './Pokemon';

class App extends React.Component {
  render () {

  return (
    <div className="App">
     <Pokemon pokeData={pokeList} />
    </div>
  );
}
}


export default App;
